import EditDetails from "./pages/EditDetails";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
  const currentUser = true;
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>
        <Route path="/department">
          <Department />
        </Route>
        <Route path="/EditEmployee/editID/:id">
          <EditDetails />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
